import React from "react";
import ReactExport from "react-data-export";
import Button from '@material-ui/core/Button';
import withStyles from '@material-ui/core/styles/withStyles';
const ExcelFile = ReactExport.ExcelFile;
const ExcelSheet = ReactExport.ExcelFile.ExcelSheet;
const ExcelColumn = ReactExport.ExcelFile.ExcelColumn;

const styles = theme => ({
    button: {
        marginTop: theme.spacing.unit * 3,
        marginLeft: theme.spacing.unit,
        display: 'inline-flex',
        justifyContent: 'center',
        align: 'center',
    }

});


class Download extends React.Component {
    render() {
        const { classes, dataArray } = this.props;
        const formatArray = [];
        const multiDataSet = [];

        const columnsArray = [
            {title: "Rec Number", width: {wpx: 20},
                style: {
                    fill: {patternType: "solid", fgColor: {rgb: "FF00FF00"}},
                    font:{sz: "14", bold: true},
                    alignment: {vertical: "center", horizontal: "center"},
                    border: {bottom: {style: "thick", color: { rgb: "FFFFAA00" }}},
                    numFmt: "0"

                }
            },
            {title: "Scan Date", width: {wpx: 20},
                style: {
                    fill: {patternType: "solid", fgColor: {rgb: "FF00FF00"}},
                    font:{sz: "14", bold: true},
                    alignment: {vertical: "center", horizontal: "center"},
                    border: {bottom: {style: "thick", color: { rgb: "FFFFAA00" }}},
                    numFmt: "yyyy-mm-dd"

                }
            },
            {title: "Scan Code", width: {wpx: 20},
                style: {
                    fill: {patternType: "solid", fgColor: {rgb: "FF00FF00"}},
                    font:{sz: "14", bold: true},
                    alignment: {vertical: "center", horizontal: "center"},
                    border: {bottom: {style: "thick", color: { rgb: "FFFFAA00" }}}

                }
            },
            {title: "Product", width: {wpx: 20},
                style: {
                    fill: {patternType: "solid", fgColor: {rgb: "FF00FF00"}},
                    font:{sz: "14", bold: true},
                    alignment: {vertical: "center", horizontal: "center"},
                    border: {bottom: {style: "thick", color: { rgb: "FFFFAA00" }}}

                }
            },
            {title: "Quantity", width: {wpx: 20},
                style: {
                    fill: {patternType: "solid", fgColor: {rgb: "FF00FF00"}},
                    font:{sz: "14", bold: true},
                    alignment: {vertical: "center", horizontal: "center"},
                    border: {bottom: {style: "thick", color: { rgb: "FFFFAA00" }}},
                    numFmt: "#,##0"

                }
            },
            {title: "Tag Number", width: {wpx: 20},
                style: {
                    fill: {patternType: "solid", fgColor: {rgb: "FF00FF00"}},
                    font:{sz: "14", bold: true},
                    alignment: {vertical: "center", horizontal: "center"},
                    border: {bottom: {style: "thick", color: { rgb: "FFFFAA00" }}},
                    numFmt: "#,##0"

                }
            }
        ];

        multiDataSet.push({columns: columnsArray});


        //have to loop through data being passed and create an array of objects

        //looping through array
        for (let i = 0; i < dataArray.length(); i++) {
            const keyHolder = [];
            //putting all the keys into an array
            keyHolder = Object.keys(dataArray[i]);
                for (const key of keyHolder) {
                    dataArray[i][key]
                }
        }


        return (
            <ExcelFile element={
                <Button
                    variant="contained"
                    color="primary"
                    className={classes.button}
                    align='center'
                >
                    Download Report
                </Button>
            }>
                <ExcelSheet data={dataArray} name="Scanned_Report">
                    <ExcelColumn label="Rec Number" value="recno" />
                    <ExcelColumn label="Scan Date" value="scandate"/>
                    <ExcelColumn label="Scan Code" value="scancode"/>
                    <ExcelColumn label="Product" value="product"/>
                    <ExcelColumn label="Quantity" value="quantity"/>
                    <ExcelColumn label="Tag Number" value="tagnum"/>
                    {/*<ExcelColumn label="Marital Status"*/}
                                 {/*value={(col) => col.is_married ? "Married" : "Single"}/>*/}
                </ExcelSheet>
            </ExcelFile>
        );
    }
}

export default withStyles(styles)(Download);
